import React from 'react'
import { useAuth } from '../../utils/useAuth';
import { Navigate } from 'react-router-dom';

function Logout() {
  const {token} = useAuth();
  return (
    <button onClick={(e)=> {
      e.preventDefault();
       localStorage.removeItem("token") && console.log(token)
    }
     
    }>Logout</button>
  )
}

export default Logout
